import React from 'react'
import logo from './img/logo.jpeg';
import sre from './img/search.png';
import { Link } from 'react-scroll';
import './nav.css';

const Navbar = () => {
  return (
    <div className='container'>

      <div className="nav1">
        <div className="logos">
        <img src={logo} alt="" className="logo" />
        <p className="logotxt">bookish <br /> <h5 className='txt'>online book store </h5> </p> 
        </div>

        <div className="inputs">
        <img src={sre} alt="" className="inputimg" />
        <input type="text"  className='search' placeholder='Search by title,author,keyword'/>

        </div>
        <Link className="btn">Find my book</Link>
      </div>






    </div>
  )
}

export default Navbar;
